from Crypto.Util.number import long_to_bytes
import math

def isqrt(n):
    x = n
    y = (x + n // x) // 2
    while y < x:
        x = y
        y = (x + n // x) // 2
    return x

def fermat(n):
    if n % 2 == 0:
        return 2, n // 2

    a = isqrt(n)
    b2 = a*a - n
    b = isqrt(b2)
    max_iterations = 10000
    count = 0
    while b*b != b2:
        a += 1
        b2 = a*a - n
        b = isqrt(b2)
        count += 1
        if count > max_iterations:
            raise Exception("Không thể phân tích sau {} lần lặp".format(max_iterations))

    p = a + b
    q = a - b
    assert n == p * q
    return p, q

